import basketImage from "../imgs/basket-image.svg"
import {Link} from "react-router-dom"

const ProductItem = (props) => {
    let keys = []
    const randomKey = () => {

        let key = Math.floor(Math.random() * (90000000 - 10) + 10)

        if (keys.length == 0 || keys.map(element => key !== element)) {
            keys = [...keys, key]
            return key

        } else {
            randomKey()
        }
    }
    return (
        <div className="card" key={randomKey()}>
            <img height="420" className="img" src={props.image} alt="photo"/>
                <h1 className="h1-card">{props.name}</h1>
                <p className="p-card">Known for her sculptural takes on traditional  tailoring, Australian arbiter
                    of cool Kym Ellery teams  up with Moda Operandi.</p>
                <p className="prices">{props.price}</p>
                <div className="add-to-card"><Link to={props.link}>
                    <img src={basketImage} alt="basket"/>
                <p className="add-p">Add to Cart</p>
                    </Link>
                </div>
        </div>
    )
}
export default ProductItem
